import React, { Component } from 'react';
import PropTypes from 'prop-types';

class SpeakerCard extends Component {

  render() {
    return (
      <div>
        <div className="card col-4 cardmin">
            <img className="card-img-top" src='/static/speakers/Speaker-8367.jpg'/>
            <div className="card-body">

                <a href="#" className="btn btn-lg btn-block btn-outline-primary margintopbottom10">See Profile</a>
                    <h4 className="card-title">{this.props.speaker.userFirstName}</h4>
                    <p className="card-text">{this.props.speaker.bioShort}</p>

            </div>
        </div>
    </div>
    )
  }
}
SpeakerCard.prototype = {};

export default SpeakerCard;
